  1"use client";
  2
  3import { useCallback, useEffect, useRef, useState } from "react";
  4import { useRouter } from "next/navigation";
  5import { useTranslations } from "next-intl";
  6import { motion } from "framer-motion";
  7import { Plus } from "lucide-react";
  8import { useAppStore, type ImageAttachment } from "@/lib/store";
  9import { connectToAgent, type AgentCallbacks } from "@/lib/agent-client";
 10import { getPhaseForStep } from "@/lib/progress-config";
 11import { createMilestoneThrottler } from "@/lib/milestone-extractor";
 12import { useChatPersistence } from "@/lib/use-chat-persistence";
 13import { useDebugStore } from "@/lib/debug-store";
 14import { useDebugShortcut } from "@/lib/use-debug-shortcut";
 15import ChatPanel from "@/components/chat/ChatPanel";
 16import LivePreview from "@/components/preview/LivePreview";
 17import DebugTerminal from "@/components/debug/DebugTerminal";
 18import ProjectDrawer from "@/components/project/ProjectDrawer";
 19import ProjectDrawerToggle from "@/components/project/ProjectDrawerToggle";
 20import WorkspaceHeader from "@/components/build/WorkspaceHeader";
 21
 22import StepIndicator from "@/components/progress/StepIndicator";
 23import Logo from "@/components/brand/Logo";
 24import LanguageToggle from "@/components/brand/LanguageToggle";
 25
 26function formatInitialMessage(locale: "he" | "en"): string {
 27  return locale === "he"
 28    ? "!  / "
 29    : "Hey! I'm ready to start";
 30}
 31
 32function formatWorkspaceContext(locale: "he" | "en"): string {
 33  return `[WORKSPACE MODE]
 34The user is returning to an existing project. Do NOT run the step system or progress.sh.
 35Read CLAUDE.md for project context. Start the dev server if not running.
 36Wait for the user's message  they will tell you what they need.
 37Locale: ${locale}`;
 38}
 39
 40export default function BuildPage() {
 41  const t = useTranslations("Build");
 42  const router = useRouter();
 43  const store = useAppStore();
 44  const abortRef = useRef<{ abort: () => void } | null>(null);
 45  const hasStarted = useRef(false);
 46  const milestoneExtractor = useRef(createMilestoneThrottler(store.locale));
 47  const [showRecoveryBanner, setShowRecoveryBanner] = useState(false);
 48  const [refreshTrigger, setRefreshTrigger] = useState(0);
 49
 50  const isWorkspace = store.isWorkspaceMode;
 51
 52  useDebugShortcut();
 53
 54  // Persistence
 55  const { isLoaded } = useChatPersistence(store.projectDir);
 56
 57  // Recover projectDir from electron-store if missing
 58  useEffect(() => {
 59    if (!store.projectDir) {
 60      window.electronAPI?.getActiveProject?.().then((meta: { path?: string; id?: string; name?: string } | null) => {
 61        if (meta?.path) {
 62          store.setProjectDir(meta.path);
 63          if (meta.id) store.setActiveProjectId(meta.id);
 64          if (meta.name) store.setProjectName(meta.name);
 65        }
 66      }).catch(() => {});
 67    }
 68  }, []); // eslint-disable-line react-hooks/exhaustive-deps
 69
 70  // Load milestones when project dir is available
 71  useEffect(() => {
 72    if (!store.projectDir) return;
 73    window.electronAPI?.loadMilestones?.(store.projectDir).then((milestones: unknown[]) => {
 74      if (milestones?.length) {
 75        store.loadMilestones(milestones as Parameters<typeof store.loadMilestones>[0]);
 76      }
 77    }).catch(() => {});
 78  }, [store.projectDir]); // eslint-disable-line react-hooks/exhaustive-deps
 79
 80  // Watch for pending chat messages from other components (e.g. project drawer)
 81  useEffect(() => {
 82    const msg = store.pendingChatMessage;
 83    if (msg) {
 84      store.setPendingChatMessage(null);
 85      sendToAgent(msg);
 86    }
 87  }, [store.pendingChatMessage]); // eslint-disable-line react-hooks/exhaustive-deps
 88
 89  // Start agentic flow once persistence has loaded
 90  useEffect(() => {
 91    if (hasStarted.current) return;
 92    if (!isLoaded) return;
 93    if (!store.projectDir) return;
 94    hasStarted.current = true;
 95
 96    // If we have restored messages, show recovery banner and skip initial prompt
 97    if (store.messages.length > 0) {
 98      setShowRecoveryBanner(true);
 99      // In workspace mode, also try to start the dev server preview
100      if (isWorkspace) {
101        window.electronAPI?.pollPort?.(3000).then((ready: boolean) => {
102          if (ready) store.setPreviewUrl("http://localhost:3000");
103        });
104      }
105      return;
106    }
107
108    // If resuming a session, don't re-send the initial prompt
109    if (store.sessionId) {
110      // In workspace mode, try to detect running dev server
111      if (isWorkspace) {
112        window.electronAPI?.pollPort?.(3000).then((ready: boolean) => {
113          if (ready) store.setPreviewUrl("http://localhost:3000");
114        });
115      }
116      return;
117    }
118
119    // Workspace mode: send context message, then wait for user
120    if (isWorkspace) {
121      sendToAgent(formatWorkspaceContext(store.locale));
122      return;
123    }
124
125    // Wizard mode: send initial greeting
126    sendToAgent(formatInitialMessage(store.locale));
127  }, [isLoaded, store.projectDir]); // eslint-disable-line react-hooks/exhaustive-deps
128
129  const sendToAgent = useCallback(
130    (prompt: string, images?: ImageAttachment[]) => {
131      // Add user message to chat
132      store.addMessage({
133        id: `user-${Date.now()}`,
134        role: "user",
135        content: prompt,
136        timestamp: Date.now(),
137        images,
138      });
139
140      // Hide suggestion chips after first user message
141      if (isWorkspace && store.chipsVisible) {
142        store.hideChips();
143      }
144
145      store.setStreaming(true);
146
147      abortRef.current = connectToAgent({
148        prompt,
149        images,
150        locale: store.locale,
151        projectDir: store.projectDir || undefined,
152        sessionId: store.sessionId || undefined,
153        onMessage: (msg) => {
154          store.addMessage(msg);
155          // Extract milestones for the project activity log
156          const milestone = milestoneExtractor.current(msg);
157          if (milestone) {
158            store.addMilestone(milestone);
159            // Persist milestones
160            if (store.projectDir) {
161              const allMilestones = [...useAppStore.getState().milestones];
162              window.electronAPI?.saveMilestones?.(store.projectDir, allMilestones).catch(() => {});
163            }
164          }
165        },
166        onSessionId: (sessionId) => {
167          store.setSessionId(sessionId);
168          // Persist to electron-store
169          const projectId = store.activeProjectId;
170          if (projectId) {
171            window.electronAPI?.updateProject?.(projectId, { sessionId }).catch(() => {});
172          }
173        },
174        onDone: () => {
175          store.setStreaming(false);
176        },
177        onRawEvent: (raw, timestamp) => {
178          useDebugStore.getState().addEvent(raw, timestamp);
179        },
180        onError: (err) => {
181          store.setStreaming(false);
182          store.addMessage({
183            id: `error-${Date.now()}`,
184            role: "status",
185            content:
186              store.locale === "he"
187                ? ",  ..."
188                : "Hmm, let me try that again...",
189            timestamp: Date.now(),
190          });
191        },
192        callbacks: {
193          onDevServerDetected: () => {
194            // Poll port 3000 and set preview URL when ready
195            window.electronAPI?.pollPort?.(3000).then((ready: boolean) => {
196              if (ready) {
197                store.setPreviewUrl("http://localhost:3000");
198              }
199            });
200          },
201          onFileChanged: () => {
202            setRefreshTrigger((c) => c + 1);
203          },
204          onStepCompleted: (step) => {
205            store.completeStep(step);
206            store.setStep(step + 1, getPhaseForStep(step + 1));
207          },
208          onLiveUrl: (url) => {
209            store.setLiveUrl(url);
210            const projectId = store.activeProjectId;
211            if (projectId) {
212              window.electronAPI?.updateProject?.(projectId, { liveUrl: url }).catch(() => {});
213            }
214          },
215        } satisfies AgentCallbacks,
216      });
217    },
218    [store, isWorkspace]
219  );
220
221  function handleSend(message: string, images?: ImageAttachment[]) {
222    if (abortRef.current) {
223      abortRef.current.abort();
224    }
225    sendToAgent(message, images);
226  }
227
228  function handleDeploy() {
229    const deployPrompt = store.locale === "he"
230      ? "     "
231      : "Deploy my latest changes to production";
232    handleSend(deployPrompt);
233  }
234
235  function handleBack() {
236    if (store.isStreaming) {
237      store.setProjectDrawerOpen(true);
238    } else {
239      store.reset();
240      router.push("/welcome");
241    }
242  }
243
244  return (
245    <div className="flex h-screen flex-col bg-dummy-yellow">
246      {/* Header */}
247      <header className="drag-region flex items-center justify-between border-b-2 border-dummy-black/10 bg-dummy-yellow px-4 py-2" style={{ paddingLeft: 80 }}>
248        <div className="no-drag flex items-center gap-2">
249          <ProjectDrawerToggle />
250          {!isWorkspace && <Logo />}
251        </div>
252
253        {isWorkspace ? (
254          <div className="no-drag flex-1">
255            <WorkspaceHeader onBack={handleBack} onDeploy={handleDeploy} />
256          </div>
257        ) : (
258          <StepIndicator />
259        )}
260
261        <div className="no-drag flex items-center gap-2">
262          {!isWorkspace && (
263            <button
264              onClick={handleBack}
265              className="rounded-md border-2 border-dummy-black/20 bg-dummy-white p-1.5 text-dummy-black/60 transition-colors hover:border-dummy-black hover:bg-dummy-black hover:text-dummy-yellow"
266              aria-label="New project"
267            >
268              <Plus className="size-4" />
269            </button>
270          )}
271          <LanguageToggle />
272        </div>
273      </header>
274
275      {/* Main content: chat + optional preview */}
276      <div className="flex flex-1 overflow-hidden">
277        {/* Chat panel */}
278        <div className={`flex flex-col overflow-hidden bg-dummy-yellow-bright/30 ${store.previewUrl ? "w-1/2" : "w-full"}`}>
279          <ChatPanel
280            onSend={handleSend}
281            showRecoveryBanner={showRecoveryBanner}
282            isWorkspaceMode={isWorkspace}
283          />
284        </div>
285
286        {/* Live preview (shown when dev server is running) */}
287        {store.previewUrl && (
288          <div className="w-1/2 border-s-2 border-dummy-black/10">
289            <LivePreview refreshTrigger={refreshTrigger} />
290          </div>
291        )}
292      </div>
293
294      {/* Feedback banner  only in wizard mode */}
295      {!isWorkspace && store.completedSteps.includes(4) && !store.isStreaming && (
296        <motion.div
297          initial={{ opacity: 0, y: 20 }}
298          animate={{ opacity: 1, y: 0 }}
299          className="border-t-2 border-dummy-black/10 bg-dummy-white px-4 py-3 text-center"
300        >
301          <p className="text-sm font-medium text-dummy-black">
302            {t("feedbackBanner")}
303          </p>
304        </motion.div>
305      )}
306
307      <DebugTerminal />
308      <ProjectDrawer />
309    </div>
310  );
311}
